            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "To clear Bit 9, the source of the ABRT_SBYTE_NORSTRT must be fixed\n"
                },
                {
                  "kind": "span",
                  "text": "first; restart must be enabled (IC_CON[5]=1), the SPECIAL bit must be\n"
                },
                {
                  "kind": "span",
                  "text": "cleared (IC_TAR[11]), or the GC_OR_START bit must be cleared\n"
                },
                {
                  "kind": "span",
                  "text": "(IC_TAR[10]). Once the source of the ABRT_SBYTE_NORSTRT is fixed, then\n"
                },
                {
                  "kind": "span",
                  "text": "this bit can be cleared in the same manner as other bits in this\n"
                },
                {
                  "kind": "span",
                  "text": "register. If the source of the ABRT_SBYTE_NORSTRT is not fixed before\n"
                },
                {
                  "kind": "span",
                  "text": "attempting to clear this bit, bit 9 clears for one cycle and then gets\n"
                },
                {
                  "kind": "span",
                  "text": "reasserted. When this field is set to 1, the restart is disabled\n"
                },
                {
                  "kind": "span",
                  "text": "(IC_RESTART_EN bit (IC_CON[5]) =0) and the user is trying to send a\n"
                },
                {
                  "kind": "span",
                  "text": "START Byte.\\n\\n Reset value: 0x0\\n\\n Role of DW_apb_i2c: Master\n"
                }
              ]
            }
