              "column": 7,
              "type": {
                "label": "RP2040_SVD.I2C.IC_ENABLE_STATUS_SLV_DISABLED_WHILE_BUSY_Field",
                "docHref": "docs/rp2040_svd__i2c___spec.html#L2711C9"
              },
              "description": [
                {
                  "kind": "paragraph",
                  "children": [
                    {
                      "kind": "span",
                      "text": "Read-only. Slave Received Data Lost. This bit indicates if a\n"
                    },
                    {
                      "kind": "span",
                      "text": "Slave-Receiver operation has been aborted with at least one data byte\n"
                    },
                    {
                      "kind": "span",
                      "text": "received from an I2C transfer due to the setting bit 0 of IC_ENABLE\n"
                    },
                    {
                      "kind": "span",
                      "text": "from 1 to 0. When read as 1, DW_apb_i2c is deemed to have been\n"
                    },
                    {
                      "kind": "span",
                      "text": "actively engaged in an aborted I2C transfer (with matching address)\n"
                    },
                    {
                      "kind": "span",
                      "text": "and the data phase of the I2C transfer has been entered, even though\n"
                    },
                    {
                      "kind": "span",
                      "text": "a data byte has been responded with a NACK.\\n\\n Note: If the remote\n"
                    },
                    {
                      "kind": "span",
                      "text": "I2C master terminates the transfer with a STOP condition before the\n"
                    },
                    {
                      "kind": "span",
                      "text": "DW_apb_i2c has a chance to NACK a transfer, and IC_ENABLE[0] has been\n"
                    },
                    {
                      "kind": "span",
                      "text": "set to 0, then this bit is also set to 1.\\n\\n When read as 0,\n"
                    },
                    {
                      "kind": "span",
                      "text": "DW_apb_i2c is deemed to have been disabled without being actively\n"
                    },
                    {
                      "kind": "span",
                      "text": "involved in the data phase of a Slave-Receiver transfer.\\n\\n Note:\n"
                    },
                    {
                      "kind": "span",
                      "text": "The CPU can safely read this bit when IC_EN (bit 0) is read as 0.\\n\\n\n"
                    },
                    {
                      "kind": "span",
                      "text": "Reset value: 0x0\n"
                    }
                  ]
                }
              ]
