            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "I2C Interrupt Status Register\\n\\n Each bit in this register has a\n"
                },
                {
                  "kind": "span",
                  "text": "corresponding mask bit in the IC_INTR_MASK register. These bits are\n"
                },
                {
                  "kind": "span",
                  "text": "cleared by reading the matching interrupt clear register. The unmasked\n"
                },
                {
                  "kind": "span",
                  "text": "raw versions of these bits are available in the IC_RAW_INTR_STAT\n"
                },
                {
                  "kind": "span",
                  "text": "register.\n"
                }
              ]
            }
