            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "I2C Receive FIFO Level Register This register contains the number of\n"
                },
                {
                  "kind": "span",
                  "text": "valid data entries in the receive FIFO buffer. It is cleared whenever: -\n"
                },
                {
                  "kind": "span",
                  "text": "The I2C is disabled - Whenever there is a transmit abort caused by any\n"
                },
                {
                  "kind": "span",
                  "text": "of the events tracked in IC_TX_ABRT_SOURCE The register increments\n"
                },
                {
                  "kind": "span",
                  "text": "whenever data is placed into the receive FIFO and decrements when data\n"
                },
                {
                  "kind": "span",
                  "text": "is taken from the receive FIFO.\n"
                }
              ]
            }
