            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "I2C SDA Hold Time Length Register\\n\\n The bits [15:0] of this register\n"
                },
                {
                  "kind": "span",
                  "text": "are used to control the hold time of SDA during transmit in both slave\n"
                },
                {
                  "kind": "span",
                  "text": "and master mode (after SCL goes from HIGH to LOW).\\n\\n The bits [23:16]\n"
                },
                {
                  "kind": "span",
                  "text": "of this register are used to extend the SDA transition (if any) whenever\n"
                },
                {
                  "kind": "span",
                  "text": "SCL is HIGH in the receiver in either master or slave mode.\\n\\n Writes\n"
                },
                {
                  "kind": "span",
                  "text": "to this register succeed only when IC_ENABLE[0]=0.\\n\\n The values in\n"
                },
                {
                  "kind": "span",
                  "text": "this register are in units of ic_clk period. The value programmed in\n"
                },
                {
                  "kind": "span",
                  "text": "IC_SDA_TX_HOLD must be greater than the minimum hold time in each mode\n"
                },
                {
                  "kind": "span",
                  "text": "(one cycle in master mode, seven cycles in slave mode) for the value to\n"
                },
                {
                  "kind": "span",
                  "text": "be implemented.\\n\\n The programmed SDA hold time during transmit\n"
                },
                {
                  "kind": "span",
                  "text": "(IC_SDA_TX_HOLD) cannot exceed at any time the duration of the low part\n"
                },
                {
                  "kind": "span",
                  "text": "of scl. Therefore the programmed value cannot be larger than\n"
                },
                {
                  "kind": "span",
                  "text": "N_SCL_LOW-2, where N_SCL_LOW is the duration of the low part of the scl\n"
                },
                {
                  "kind": "span",
                  "text": "period measured in ic_clk cycles.\n"
                }
              ]
            }
