            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "Generate Slave Data NACK Register\\n\\n The register is used to generate a\n"
                },
                {
                  "kind": "span",
                  "text": "NACK for the data part of a transfer when DW_apb_i2c is acting as a\n"
                },
                {
                  "kind": "span",
                  "text": "slave-receiver. This register only exists when the IC_SLV_DATA_NACK_ONLY\n"
                },
                {
                  "kind": "span",
                  "text": "parameter is set to 1. When this parameter disabled, this register does\n"
                },
                {
                  "kind": "span",
                  "text": "not exist and writing to the register's address has no effect.\\n\\n A\n"
                },
                {
                  "kind": "span",
                  "text": "write can occur on this register if both of the following conditions are\n"
                },
                {
                  "kind": "span",
                  "text": "met: - DW_apb_i2c is disabled (IC_ENABLE[0] = 0) - Slave part is\n"
                },
                {
                  "kind": "span",
                  "text": "inactive (IC_STATUS[6] = 0) Note: The IC_STATUS[6] is a register\n"
                },
                {
                  "kind": "span",
                  "text": "read-back location for the internal slv_activity signal; the user should\n"
                },
                {
                  "kind": "span",
                  "text": "poll this before writing the ic_slv_data_nack_only bit.\n"
                }
              ]
            }
