            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "I2C Transmit FIFO Level Register This register contains the number of\n"
                },
                {
                  "kind": "span",
                  "text": "valid data entries in the transmit FIFO buffer. It is cleared whenever:\n"
                },
                {
                  "kind": "ul",
                  "children": [
                    {
                      "kind": "li",
                      "children": [
                        {
                          "kind": "span",
                          "text": "The I2C is disabled - There is a transmit abort - that is, TX_ABRT bit\n"
                        }
                      ]
                    }
                  ]
                },
                {
                  "kind": "span",
                  "text": "is set in the IC_RAW_INTR_STAT register - The slave bulk transmit mode\n"
                },
                {
                  "kind": "span",
                  "text": "is aborted The register increments whenever data is placed into the\n"
                },
                {
                  "kind": "span",
                  "text": "transmit FIFO and decrements when data is taken from the transmit FIFO.\n"
                }
              ]
            }
